import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/js/bootstrap.js';


export function register(props){

    return (
        <div style={{margin:70}}>

            <form style={{padding:1}} class="needs-validation" noValidate>
                <div class="form-row">
                    <div class="col-md-4 mb-3">
                        <label for="fist_name">First_name</label>
                        <input 
                            type="text" 
                            class="form-control" 
                            id="first_name"
                            value=""
                            placeholder="first_name"
                            required 
                        />
                    </div>
                </div>
            </form>



        </div>

    );

}

export default register;
